import React from 'react'
import Item from './Item'

const Items = (props) => {
    const onDeleteHandler = (i) => {
        console.log('delete at index',i)
        props.onDelete
    }

    return( 
    <ol>
        {props.todos.map((todo, i) => ( 
            <Item key={i} onDelete={() => onDeleteHandler(i)}>
                {todo}
            </Item>
        ))}
    </ol>
    )
}

export default Items
